// main.js
import Vue from 'vue';
import App from './App.vue';

import Login from './components/logiForm.vue';
import Dashboard from "./components/dashBoard.vue";
const router=createRouter({
    history:createWebHistory(),
    routes:[{
        path:"/",component:Login
    }]
})
new Vue({
  render: h => h(App),
  router,
}).$mount('#app');
